function GetNewSrNo(){var n={stateid:$("#StateId").val(),distid:$("#DistId").val()};return($("#Id").val()==0||$("#Id").val().trim()==null)&&$.ajax({url:"/Administration/GetBranchSrNo/",method:"GET",dataType:"json",data:n,contentType:"application/json",success:function(n){$("#TransCode").val(n)},error:function(n){console.error(n.responseText)}}),!1}function GetDistrictList(){var n={id:$("#StateId").val()};return $.ajax({url:"/Administration/GetAllDistrictList/",method:"GET",data:n,dataType:"json",contentType:"application/json",success:function(n){$("#DistId").empty();$.each(n,function(n,t){$("#DistId").append('<option value="'+t.value+'"> '+t.text+" <\/option>")})},error:function(n){console.error(n.responseText)}}),!1}$(document).ready(function(){$("#CompName").focus();$(".custom-file-input").on("change",function(){var n=$(this).val().split("\\").pop();$(this).next(".custom-file-label").html(n)})});